import React, { useState } from 'react';
import { Nav } from 'react-bootstrap';
import logo from './logo.svg';
import './App.css';

function App() {
  var [username, usernamedata] = useState(['호랑이', '사자']);

  return (
    <div>
      <Nav variant="pills" defaultActiveKey="/home">
        <Nav.Item>
          <Nav.Link href="/home">Todo List</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1">Done List</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="disabled" disabled>{username[0]}님 저장소</Nav.Link>
        </Nav.Item>
      </Nav>

      <Todo />

    </div>
  );
}


function Todo() {
  return (
    <div>
      <div class="title">
        <h2>Todo List</h2>
      </div>
      <div class="input-box">
        <input id="input" type="text" placeholder="할 일을 입력하세요." /><button id="add">+</button>
      </div>
      <div class="list">
        <ul id="to-do-list"></ul>
      </div>
    </div>
  )
}

export default App;
